public class InnerChannelEncoderSettingsFactory(Action<Humidifier.MediaLive.ChannelTypes.EncoderSettings> factoryAction = null) : SubResourceFactory<Humidifier.MediaLive.ChannelTypes.EncoderSettings>
{

    internal InnerChannelGlobalConfigurationFactory GlobalConfigurationFactory { get; set; }

    internal InnerChannelMotionGraphicsConfigurationFactory MotionGraphicsConfigurationFactory { get; set; }

    internal InnerChannelThumbnailConfigurationFactory ThumbnailConfigurationFactory { get; set; }

    internal InnerChannelFeatureActivationsFactory FeatureActivationsFactory { get; set; }

    internal InnerChannelAvailConfigurationFactory AvailConfigurationFactory { get; set; }

    internal InnerChannelColorCorrectionSettingsFactory ColorCorrectionSettingsFactory { get; set; }

    internal InnerChannelAvailBlankingFactory AvailBlankingFactory { get; set; }

    internal InnerChannelNielsenConfigurationFactory NielsenConfigurationFactory { get; set; }

    internal InnerChannelBlackoutSlateFactory BlackoutSlateFactory { get; set; }

    internal InnerChannelTimecodeConfigFactory TimecodeConfigFactory { get; set; }

    protected override Humidifier.MediaLive.ChannelTypes.EncoderSettings Create()
    {
        var encoderSettingsResult = CreateEncoderSettings();
        factoryAction?.Invoke(encoderSettingsResult);

        return encoderSettingsResult;
    }

    private Humidifier.MediaLive.ChannelTypes.EncoderSettings CreateEncoderSettings()
    {
        var encoderSettingsResult = new Humidifier.MediaLive.ChannelTypes.EncoderSettings();

        return encoderSettingsResult;
    }
    public override void CreateChildren(Humidifier.MediaLive.ChannelTypes.EncoderSettings result)
    {
        base.CreateChildren(result);

        result.GlobalConfiguration ??= GlobalConfigurationFactory?.Build();
        result.MotionGraphicsConfiguration ??= MotionGraphicsConfigurationFactory?.Build();
        result.ThumbnailConfiguration ??= ThumbnailConfigurationFactory?.Build();
        result.FeatureActivations ??= FeatureActivationsFactory?.Build();
        result.AvailConfiguration ??= AvailConfigurationFactory?.Build();
        result.ColorCorrectionSettings ??= ColorCorrectionSettingsFactory?.Build();
        result.AvailBlanking ??= AvailBlankingFactory?.Build();
        result.NielsenConfiguration ??= NielsenConfigurationFactory?.Build();
        result.BlackoutSlate ??= BlackoutSlateFactory?.Build();
        result.TimecodeConfig ??= TimecodeConfigFactory?.Build();
    }

} // End Of Class

